        "datadescription": "The foundation and the development of Lugansk region associated with building and working of Lugansk cannon-foundry plant, which in 1800 smelted its first foundry-iron. In 1882 Lugansk plant with the nearby village Kamennyj Brod took the official status of town and soon it became the centre of Slavianoserbsky Uyezd. Since 1876 the railway workshops for repairing locomotives and carriages of active railway-road started their work. In 1895 on the place of foundry-cannon plant State cartridges plant was built and opened. The same year locomotive-building plant began its activity; and it was built by manufacturer Gustav Hartman. With time that plant became the most powerful enterprise of such profile in the Russian Empire."
